import './style.css'



function App() {
  const [person, setPerson] = useState([
    {
      name: "Ali",
      work: "BSCS",
      roll: 8,
      phone: 3153434567,
    },
    {
      name: "Ahmed",
      work: "IT",
      course: "BSCS",
      phone: 3046782340
    }
  ])


  return (<>
    <div className="App">
      <h3>Maalic's Phone Book</h3>



    </div>
  </>
  );

}
export default App;
